  summary: |2-


     <p>This method returns a serializable <code>ImmutableSortedSet</code>.

     <p>The <xref uid="SortedSet#headSet" data-throw-if-not-resolved="false">SortedSet#headSet</xref> documentation states that a subset of a subset throws an
     <xref uid="IllegalArgumentException" data-throw-if-not-resolved="false">IllegalArgumentException</xref> if passed a <code>toElement</code> greater than an earlier <code>
     toElement</code>. However, this method doesn't throw an exception in that situation, but instead
     keeps the original <code>toElement</code>.
